import React, { useEffect, useState } from 'react'
import axios from 'axios'
function HomeCard() {
  const [homeData, setHomeData] = useState([])
  const [loading, setLoading] = useState(true)
  useEffect(() => {
    const getData = async () => {
      const response = await axios.get(
        'https://api.trello.com/1/members/me/boards?key=d99233bea37b0025a58fa72dc607d4ff&token=e8c437e0e01d12dfdf3abcb5bf7fe9b8f62094009251fc654ff71d1607517edb'
      )
      console.log(response.data)
      setHomeData(response.data)
      setLoading(false)
    }
    getData()
  }, [])

  cardDisplay = () => {
    return homeData.map((item) => {
      return (
        <div key={item.id}>
          <div className="card">
            <div className="cardName">{item.name}</div>
          </div>
        </div>
      )
    })
  }
  return (
    <div>{!loading ? <div className="container">{cardDisplay}</div> : ''}</div>
  )
}
export default HomeCard
